import React from 'react';
import { Container, Col, Image} from 'react-bootstrap';

const DevicePage = () => {
    const device = {id: 1, name: 'KSV36AWEP', price: '127999', img: `0aeb8782-5544-4d2e-bce8-c6755a5040eb.jpg`};
    return (
        <Container className='mt-3'>
            <Col md={4}>
                <h2 className='text-center'>{device.name}</h2>
                <Image className='d-flex' width={300} height={300} src={device.img} />
            </Col>

            <Col md={4}>
            
            </Col>
        </Container>
    );
};

export default DevicePage;
